<template>
    <v-container>
        <v-row justify="center" class="mt-10">
            <v-col v-for="photo in photos" :key="photo.id">
                <v-card @click="goToPhoto(photo)" class="mx-auto" max-width="344">
                    <v-img height="200px"
                        src="data:image/jpeg;base64,"
                        cover></v-img>

                    <v-card-title>
                        {{ photo.title }}
                    </v-card-title>

                    <v-card-subtitle>
                        {{ photo.id }}
                    </v-card-subtitle>
                </v-card>
            </v-col>
        </v-row>
    </v-container>
</template>

<script setup>

const photos = ref([]);
onMounted(() => {
    fetch('https://jsonplaceholder.typicode.com/photos')
        .then(response => response.json())
        .then(json => {
            photos.value = json;
        });
});

function goToPhoto(photo) {
    navigateTo('/photos/' + photo.id);
}
</script>